import React, { useState, useCallback } from 'react';
import { Form, Table } from 'antd';
import styled from 'styled-components';

const CenterDiv = styled.div`
    width: 50%;
    margin : 0 auto;
    margin-top: 20px;
`;

const data = [{
    id: 1,
    bucket: "돈 500만원 모으기",
}, {
    id: 2,
    bucket: "나만의 프로젝트 만들기"
}];

const EditUser = () => { 
    return (
        <Form>
            <CenterDiv>
                <Table dataSource={data}>
                    <Table.Column title="Bucket List" dataInex="bucket" key="bucket" />
                    <Table.Column title="Delete">delete</Table.Column>
                </Table>
            </CenterDiv>
        </Form>
    );
}

export default EditUser;
